import React from "react";
//import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Navbar from "./components/layouts/NavBar";
import Footer from "./components/layouts/Footer";
// React Router Import
import { Switch, Route } from "react-router-dom";
// Import Pages
import Home from "./components/pages/Home";
import Canteens from "./components/pages/Canteens";
import About from "./components/pages/About";
import Stalls from "./components/pages/Stalls";
import Details from "./components/pages/Details";
import FoodDetails from "./components/pages/FoodDetails";
import NotFoundPage from "./components/pages/NotFoundPage";

function App() {
    return (
        <div>
            <Navbar />
            <Switch>
                <Route exact path="/" component={Home} />
                <Route exact path="/canteens" component={Canteens} />
                <Route path="/about" component={About} />
                <Route path="/details" component={Details} />
                <Route path="/fooddetails" component={FoodDetails} />
                <Route path=":canteen/stalls" component={Stalls} />
                <Route component={NotFoundPage} />
            </Switch>
            <Footer />
        </div>
    );
}

export default App;
